import React, { Component , useState , useEffect} from 'react';
import testData from "../Data/data.json"
import '../css/test.css'



const YourAnswers = ({answers}) => {


    return(
        <div>




            <section className="modal-card-body content">



                {
                    testData.data.map((question , i = 0) => (
                        <div>
                        <ul className="co-md-4 result_ul">
                    <li  className="co-md-4">

                        <p><strong>{question.question}</strong></p>

                        {testData.data[i++].answer === "yes" &&

                        <p className='has-background-danger has-text-white p-2'>Your answer: { testData.data[i++].answer }</p>

                        }

                        {testData.data[i++].answer === "no" &&

                        <p className='has-background-success has-text-white p-2'>Your answer: { testData.data[i++].answer }</p>

                        }

                        {testData.data[i++].answer === "sometimes" &&

                        <p className='has-background-info has-text-white p-2'>Your answer: { testData.data[i++].answer }</p>

                        }
                    </li>


                </ul>
                <hr/>
                        </div>
                    ))}



            </section>






        </div>
    );

}

export default YourAnswers;
